bmk = '(–ö–æ–¥: 18.03.02) –ë–ú–ö - –¢–µ—Ö–Ω–∏–∫–∞ –∑–∞—â–∏—Ç—ã –Ω–µ—Ñ—Ç–µ–≥–∞–∑–æ–≤–æ–≥–æ –æ–±–æ—Ä—É–¥–æ–≤–∞–Ω–∏—è –æ—Ç –∫–æ—Ä—Ä–æ–∑–∏–∏üòä \n \n –°–ø–µ—Ü–∏–∞–ª–∏—Å—Ç –ø–æ –∑–∞—â–∏—Ç–µ –æ—Ç –∫–æ—Ä—Ä–æ–∑–∏–∏, –∏–Ω–∂–µ–Ω–µ—Ä –ø–æ —ç–ª–µ–∫—Ç—Ä–æ—Ö–∏–º–∏—á–µ—Å–∫–æ–π –∑–∞—â–∏—Ç–µ, —Å–ø–µ—Ü–∏–∞–ª–∏—Å—Ç –ø–æ —Å–∏—Å—Ç–µ–º–∞–º –∑–∞—â–∏—Ç–Ω—ã—Ö –ø–æ–∫—Ä—ã—Ç–∏–π \n \n –†–∞–∑—Ä–∞–±–∞—Ç—ã–≤–∞–µ—Ç –∏ –∫–æ–Ω—Ç—Ä–æ–ª–∏—Ä—É–µ—Ç —Å–∏—Å—Ç–µ–º—ã –ø—Ä–æ—Ç–∏–≤–æ–∫–æ—Ä—Ä–æ–∑–∏–æ–Ω–Ω–æ–π –∑–∞—â–∏—Ç—ã –æ–±–æ—Ä—É–¥–æ–≤–∞–Ω–∏—è;–ü—Ä–æ–≤–æ–¥–∏—Ç –∫–æ—Ä—Ä–æ–∑–∏–æ–Ω–Ω—ã–π –º–æ–Ω–∏—Ç–æ—Ä–∏–Ω–≥, —Ä–∞—Å—Å–ª–µ–¥–æ–≤–∞–Ω–∏–µ –∞–≤–∞—Ä–∏–π;–†–∞–∑—Ä–∞–±–∞—Ç—ã–≤–∞–µ—Ç –∏ –ø—Ä–æ–≤–æ–¥–∏—Ç —ç–∫—Å–ø–µ—Ä—Ç–∏–∑—É –∞–Ω—Ç–∏–∫–æ—Ä—Ä–æ–∑–∏–æ–Ω–Ω—ã—Ö –ø–æ–∫—Ä—ã—Ç–∏–π \n \n –ï–ì–≠:–ú–∞—Ç–µ–º–∞—Ç–∏–∫–∞, –§–∏–∑–∏–∫–∞ (–∏–ª–∏ –•–∏–º–∏—è –∏–ª–∏ –ò–Ω—Ñ–æ—Ä–º–∞—Ç–∏–∫–∞), –†—É—Å—Å–∫–∏–π —è–∑—ã–∫ \n \n'

